import React from 'react';
import CanvasContainer from './containers/CanvasContainer.js';
import './App.css';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import fetchPins from './actions/fetchPins.js'

const App = (props) => {
  return (
    <Router>
      {<div className="App">
        <CanvasContainer />
        <Switch>
          <Route path="/maps/:id" render={(match) => fetchPins(match.params.id) } />
        </Switch>
      </div>}
    </Router>
  );
}

export default App;
